  this.setState({ initialValue: event.target.value }),
  removeErrorNotNull(classInput, classSymbol);
};

const InputWitchCkeckingNotNull = ({
  classInput, initialValue, classSymbol, setState,
}) => (
  <>
    <input
      className={classInput}
      type="text"
      name="firstName"
      value={initialValue}
      onChange={((event) => {
        setState({ initialValue: event.target.value });
        removeErrorNotNull(classInput, classSymbol);
      })}
    />
    <ErrorSymbol Class={`${classSymbol} -disabled`} />
  </>
);

